function PortalFail(msg, dump) {
	if(window.$Portal == undefined || !$Portal.fatalPass) return false;

	var tmp = '' + (msg || '') + (dump || '');
	var hash = 0, i, chr, len;
	for(i = 0, len = tmp.length; i < len; i++) {
		chr = tmp.charCodeAt(i);
		hash = ((hash << 5) - hash) + chr;
		hash |= 0; // Convert to 32bit integer
	}

 	var now = (new Date()).getTime();
	if(typeof($Portal.fatalLogBuf[hash]) == 'undefined') $Portal.fatalLogBuf[hash] = now - 61000;

	if((now - $Portal.fatalLogBuf[hash]) < 60000) return true;
	$Portal.fatalLogBuf[hash] = now;

	$.ajax({
		url: '/fail.htm',
		type: 'POST',
		cache: false,
		dataType: 'script',
		data: {
			'pass': $Portal.fatalPass,
			'msg': msg,
			'dump': dump
		}
	});

	return true;
}

/** @return string */
function PortalGetStack(error) {
	if(typeof error != 'undefined' && typeof error.stack != 'undefined') return error.stack;
	return '';
}

