		this.DivPages.empty();

		if(this.Attr.OnPage < 1) return;
		var pageLast = Math.ceil(this.Prop.Count / this.Attr.OnPage);
		if(this.Prop.Page > pageLast) this.Prop.Page = pageLast;
		if(this.Prop.Page < 1) this.Prop.Page = 1;

		this.Prop.Page = parseInt(this.Prop.Page);
		this.Attr.PagingSpread = parseInt(this.Attr.PagingSpread);

